import styled from  'styled-components';

class Comment extends Component {

    render() {
        return (
            <div>
               <TextArea>
                   <Comt></Comt>
               </TextArea>
            </div>
        );
    }
}

export default Comment;

const TextArea = styled.div`
    margin-top: 100px;
`

const Comt = styled.textarea `
   width:25rem;
   height:2rem;
`
